  `birth_country` varchar(255) DEFAULT NULL,
  `nationality` varchar(255) DEFAULT NULL,
  `height` int DEFAULT NULL,
  `weight` int DEFAULT NULL,
  `injured` enum('true','false') DEFAULT NULL,
  `photo` varchar(255) DEFAULT NULL,
  `team_id` bigint DEFAULT NULL,
  `position` varchar(255) DEFAULT NULL,
  `rating` float DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `player_name_idx` (`name`,`firstname`,`lastname`),
  KEY `player_fk_2` (`team_id`),
  CONSTRAINT `player_fk_2` FOREIGN KEY (`team_id`) REFERENCES `team` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
